import React from 'react';
import './info.css';

export default function Contact(){
    return (
        <>
        <div id="top" class="row">
          <div class="col-11">
            <h1>We're here to help you</h1>
          </div>
          <div class="col-1">
            <nav class="navbar navbar-expand-md navbar-light">
            <Link to="/mainpage">
                <span id="back" class="fw-bold">
                    Back to Home                    
                </span></Link>

            </nav>
          </div>
        </div>
        </>
    );
}
